            email : "",
            password : ""
        }
    }




    render(){
        return(
            <>

             <label>Email</label>
             <input

                type = "text"
                name = "email"
                value = {this.state.email}
                onChange = {this.onChangeHandler}



             />

            </>
        )
    }
}

export default Token;
